  `time` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `status` tinyint(3) unsigned DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `idx_status` (`status`),
  KEY `idx_starttime` (`start_time`)
